const initialState = [];

const LoggedUserReducer = (state = initialState, action) => {
    console.log("REDUCER")
    console.log(localStorage.getItem("authorization"))
    switch(action.type){
        case "FETCH_LOGGED_USER":
            return action.payload;
        default:
            return state;
    }
}

export default LoggedUserReducer;
